**Component**:
Secrets Manager

**Describe the bug**
On AWS Secret Manager it is possible to define a secret as a list of key/value (json) or a plain text (string):
![Capture dcran 2022-04-21 181457](https://user-images.githubusercontent.com/3809685/164505560-3ec95e58-cd2b-4237-b7cb-5f9143e0e22d.png)
The plain text can be used to store rsa keys, for instance.
But the implementation in `AwsSecretsManagerPropertySource` doesn't allow plain text secrets, only json based secrets. When trying to use a plain text we end up with a json parsing error:

```	at io.awspring.cloud.secretsmanager.AwsSecretsManagerPropertySource.readSecretValue(AwsSecretsManagerPropertySource.java:91)
	at io.awspring.cloud.secretsmanager.AwsSecretsManagerPropertySource.init(AwsSecretsManagerPropertySource.java:64)
	at io.awspring.cloud.secretsmanager.AwsSecretsManagerPropertySources.createPropertySource(AwsSecretsManagerPropertySources.java:87)
	... 10 common frames omitted
Caused by: com.fasterxml.jackson.core.JsonParseException: Unexpected character ('-' (code 45)) in numeric value:
```


**Solution**
Change `AwsSecretsManagerPropertySource` to handle plain text secrets if a json is not detected by adding a `catch (JsonParseException e)` block:

```java
GetSecretValueResult secretValueResult = source
		.getSecretValue(secretValueRequest);
try {
	Map<String, Object> secretMap = jsonMapper.readValue(
		secretValueResult.getSecretString(),
		new TypeReference<Map<String, Object>>() {
		});

	for (Map.Entry<String, Object> secretEntry : secretMap.entrySet()) {
		properties.put(secretEntry.getKey(), secretEntry.getValue());
	}
} catch (JsonParseException e) {
	// If the secret is not a JSON string, then it is a simple string
	properties.put(secretValueResult.getName(), secretValueResult.getSecretString());
}
````", 'reactions': {'url': 'https://api.github.com/repos/awspring/spring-cloud-aws/issues/337/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/awspring/spring-cloud-aws/issues/337/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/awspring/spring-cloud-aws/issues/comments/1106200101', 'html_url': 'https://github.com/awspring/spring-cloud-aws/issues/337#issuecomment-1106200101', 'issue_url': 'https://api.github.com/repos/awspring/spring-cloud-aws/issues/337', 'id': 1106200101, 'node_id': 'IC_kwDOEeLdrM5B70Yl', 'user': {'login': 'maciejwalkowiak', 'id': 1357927, 'node_id': 'MDQ6VXNlcjEzNTc5Mjc=', 'avatar_url': 'https://avatars.githubusercontent.com/u/1357927?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/maciejwalkowiak', 'html_url': 'https://github.com/maciejwalkowiak', 'followers_url': 'https://api.github.com/users/maciejwalkowiak/followers', 'following_url': 'https://api.github.com/users/maciejwalkowiak/following{/other_user}', 'gists_url': 'https://api.github.com/users/maciejwalkowiak/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/maciejwalkowiak/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/maciejwalkowiak/subscriptions', 'organizations_url': 'https://api.github.com/users/maciejwalkowiak/orgs', 'repos_url': 'https://api.github.com/users/maciejwalkowiak/repos', 'events_url': 'https://api.github.com/users/maciejwalkowiak/events{/privacy}', 'received_events_url': 'https://api.github.com/users/maciejwalkowiak/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-22T08:44:47Z', 'updated_at': '2022-04-22T08:44:47Z', 'author_association': 'CONTRIBUTOR', 'body': "Thanks @anthofo for reporting and preparing a PR. I'll take a deeper look next week.", 'reactions': {'url': 'https://api.github.com/repos/awspring/spring-cloud-aw