**Is your feature request related to a problem? Please describe.**
We would like to be able to take advantage of this library's `WritableResource` creation by just using a `s3://` URL. Unfortunately there's not quite enough flexibility in determining the content type. [The code in SimpleStorageNameUtils](https://github.com/awspring/spring-cloud-aws/blob/94ad5ac4015be5491e0dc29d551d06531d75e28a/spring-cloud-aws-core/src/main/java/io/awspring/cloud/core/io/s3/SimpleStorageNameUtils.java#L106) makes a call to `URLConnection#guessContentTypeFromName()` which is [difficult to extend](https://docs.oracle.com/javase/8/docs/api/java/net/URLConnection.html#getFileNameMap--).

As a result, we have to manually create and upload using `AmazonS3` (or `TransferManager`).

As of Java 1.6, there is a facility called [MimeTypesFiletypeMap](https://docs.oracle.com/javase/8/docs/api/javax/activation/MimetypesFileTypeMap.html) which is similar but somewhat easier to customize. Any `META-INF/mime.types` file in your app classpath can augment the default types, and provide a mapping from file extension to content type.

This proposal is to augment (if not replace) the `URLConnection` call to make it easier to use user-defined mappings.

**Describe the solution you'd like**
Something like:

```java
static String getContentTypeFromLocation(String location) {
    String objectName = getObjectNameFromLocation(location);
    if (StringUtils.hasLength(objectName)) {
      String contentType = FileTypeMap.getDefaultFileTypeMap().getContentType(objectName);
      if (contentType == null) {
        contentType = URLConnection.guessContentTypeFromName(objectName);
      }

      return contentType;
    }
    return null;
}
```

**Additional context**
The `FileTypeMap` is in javax.activation API, which does seem to be included as a dependency for this project.

Assuming you agree with the general premise, I'd be happy to put together a PR for this.
