**Is your feature request related to a problem? Please describe.**
When I use the `AmazonS3` (or `AmazonS3Client`) injected by Spring, it is impossible to set any configurations available in the `com.amazonaws.ClientConfiguration` class.

**Describe the solution you'd like**
It might be very useful if such configurations were available through the `application.yml` file, under the `cloud.aws` root. For example, we could use the property `cloud.aws.client.configurations.connection-timeout` to configure the `com.amazonaws.ClientConfiguration.connectionTimeout` attribute.

**Describe alternatives you've considered**
The only available alternative is not to use Spring Cloud AWS and instance the `AmazonS3` by hand.

I can try to help with this request :)

