1. By naming convention

Users can provide a bean of type `ClientOverrideConfiguration` with a name matching particular builder. For example to configure S3 Client configuration they would create:

```java
@Bean
ClientOverrideConfiguration s3ClientOverrideConfiguration() {
   ...
}
```

2. We provide an interface like:

```java
import software.amazon.awssdk.core.client.config.ClientOverrideConfiguration;
import software.amazon.awssdk.http.SdkHttpClient;

import org.springframework.lang.Nullable;

public interface AwsClientConfigurer<AwsClientBuilder> {

	@Nullable
	default ClientOverrideConfiguration overrideConfiguration() {
		return null;
	}

	@Nullable
	default <T extends SdkHttpClient.Builder<T>> SdkHttpClient.Builder<T> httpClientBuilder() {
		return null;
	}
}
```

and users can provide:

```java
@Configuration
class S3ClientBuilderConfigurer implements AwsClientConfigurer<S3ClientBuilder> {

	@Override public ClientOverrideConfiguration overrideConfiguration() {
		return ClientOverrideConfiguration.builder().apiCallAttemptTimeout(Duration.ofSeconds(2)).build();
	}
}
```

2nd option is nicer in a way that relies on types and less on strings (names). `AwsClientConfigurer` should be used then in `AwsClientBuilderConfigurer` (perhaps the naming does not make sense anymore), or these two concepts should be merged.

As a part of POC I came up with:

```
public class AwsClientBuilderConfigurer {
	private final AwsCredentialsProvider credentialsProvider;
	private final AwsRegionProvider regionProvider;
	private final AwsProperties awsProperties;

	AwsClientBuilderConfigurer(AwsCredentialsProvider credentialsProvider, AwsRegionProvider regionProvider,
			AwsProperties awsProperties) {
		this.credentialsProvider = credentialsProvider;
		this.regionProvider = regionProvider;
		this.awsProperties = awsProperties;
	}

	public <T extends AwsSyncClientBuilder<?,?> & AwsClientBuilder<?, ?>> T configure(T builder,
			AwsClientProperties clientProperties, @Nullable AwsClientConfigurer<T> configurer) {

		Region region = StringUtils.hasLength(clientProperties.getRegion()) ? Region.of(clientProperties.getRegion())
				: regionProvider.getRegion();
		builder.credentialsProvider(credentialsProvider).region(region)
				.overrideConfiguration(SpringCloudClientConfiguration.clientOverrideConfiguration());
		if (awsProperties.getEndpoint() != null) {
			builder.endpointOverride(awsProperties.getEndpoint());
		}
		if (clientProperties.getEndpoint() != null) {
			builder.endpointOverride(clientProperties.getEndpoint());
		}

		if (configurer != null) {
			builder.httpClientBuilder(configurer.httpClientBuilder());
			builder.overrideConfiguration(configurer.overrideConfiguration());
		}
		return builder;
	}
}
